import React from 'react';
import { Flex, Progress, Card, Space, } from 'antd';


export const Charp = () => (
  <Flex gap="middle" Horizontal>
   
  
    <Progress type="dashboard"  percent={70} status="exception" />
    <Progress percent={100} />SFS
    <Progress percent={50} showInfo={false} />

    <Space direction="Horizontal" size={16}>
  <Card
    title="Default size card"
   
    style={{
      width: 300,
    }}
  >
      <Progress  type="dashboard" percent={50} status="active" />
      <Progress type="dashboard"  percent={70} status="active" />
    <p>Card content</p>
  </Card>
  
</Space>
  </Flex>
  
)
